import React, { useState } from 'react'
import "./Res.css";
import Header from './Header';
import Menu from './Menu';
import Items from './Items';
import Footer from './Footer';
import menu_items from './Fdata'

const App = () => {
  const [list, setlist] = useState(menu_items);
  return (
    <>
       <Header/>
       <Menu/>
       <Items list={list}/>
       <Footer/>
    </>
  )
}

export default App
